--
-- Book Locations
DECLARE @BookId NVARCHAR(50)
DECLARE Csr CURSOR FOR
SELECT BookId FROM Book
OPEN Csr
FETCH NEXT FROM Csr INTO @BookId

WHILE @@FETCH_STATUS = 0
BEGIN
	-- Select random amount of locations between 1 and 2
	DECLARE @LocationCount INT, @Quantity INT
	SELECT @LocationCount = ABS(CHECKSUM(NEWID()) % 2) + 1

	DECLARE @Counter INT 
	SET @Counter = 1
	WHILE (@Counter <= @LocationCount)
	BEGIN

		-- Random Quantity
		SELECT @Quantity = ABS(CHECKSUM(NEWID()) % 2) + 1

		-- Random Location
		DECLARE @LocationId NVARCHAR(50)
		SELECT TOP 1 @LocationId = LocationId FROM [Location]
		WHERE NOT EXISTS 
		(
			SELECT * FROM [BookLocation]
			WHERE BookId = @BookId AND [BookLocation].LocationId = [Location].LocationId
		)
		ORDER BY NEWID()

		-- Insert Into Book Location

		SET @Counter = @Counter + 1
	END

	FETCH NEXT FROM Csr INTO @BookId
END
CLOSE Csr
DEALLOCATE Csr
GO

--
-- Book Author
DECLARE @BookId NVARCHAR(50)
DECLARE Csr CURSOR FOR
SELECT BookId FROM Book
OPEN Csr
FETCH NEXT FROM Csr INTO @BookId

WHILE @@FETCH_STATUS = 0
BEGIN
	-- Select random amount of authors between 1 and 2
	DECLARE @AuthCount INT
	SELECT @AuthCount = ABS(CHECKSUM(NEWID()) % 2) + 1

	DECLARE @Counter INT 
	SET @Counter = 1
	WHILE (@Counter <= @AuthCount)
	BEGIN
		SELECT TOP 1 NEWID(), @BookId, AuthorId
		FROM Author WHERE NOT EXISTS (SELECT 1 FROM BookAuthor WHERE @BookId = BookId AND Author.AuthorId = BookAuthor.AuthorId)
		ORDER BY NEWID()

		SET @Counter = @Counter + 1
	END

	FETCH NEXT FROM Csr INTO @BookId
END
CLOSE Csr
DEALLOCATE Csr
GO

--
-- Book Genre
DECLARE @BookId NVARCHAR(50)
DECLARE Csr CURSOR FOR
SELECT BookId FROM Book
OPEN Csr
FETCH NEXT FROM Csr INTO @BookId

WHILE @@FETCH_STATUS = 0
BEGIN
	-- Select random amount of Genres between 1 and 2
	DECLARE @GenreCount INT
	SELECT @GenreCount = ABS(CHECKSUM(NEWID()) % 2) + 1

	DECLARE @Counter INT 
	SET @Counter = 1
	WHILE (@Counter <= @GenreCount)
	BEGIN
		SELECT TOP 1 NEWID(), @BookId, GenreId
		FROM Genre WHERE NOT EXISTS (SELECT 1 FROM BookGenre WHERE @BookId = BookId AND Genre.GenreId = BookGenre.GenreId)
		ORDER BY NEWID()

		SET @Counter = @Counter + 1
	END

	FETCH NEXT FROM Csr INTO @BookId
END
CLOSE Csr
DEALLOCATE Csr
GO

